<!doctype html>
<html>
    <head>
        <meta charset="utf-8" />
        <link rel="stylesheet" type="text/css" href="memcheck-cover.css">
        <script type="text/javascript" src="memcheck-cover.js"></script>

        <!-- Vagrind reports asynchronous loading parts -->
        <script src="mismatched_delete.memcheck.html.part" async="async"></script>
    </head>
    <body>
        <div class="report_header">
            <div class="report_title">
                Valgrind's memcheck report
            </div>
            <div class="report_separator"></div>
        </div>
        <div class="report_summary">
            <div class="report_summary_title">Result summary:</div>
            <div class="report_summary_ratio" title="Errors: 1" style="background-image: linear-gradient(to right, #00CF00 0%, orange 0%, orange 0%, red 0%, red 100%);">
                Pass: 0 / 1
            </div>
            <div class="report_summary_errors">Errors: 1</div>
            <div class="report_summary_infos">Infos: 1</div>
            <br /><br />
            <div title="Expand all" onclick="JavaScript: ExpandAll();" class="expandall"><div></div><div></div><div></div></div>
            <div title="Collapse all" onclick="JavaScript: CollapseAll();" class="collapseall"><div></div><div></div><div></div></div>
        </div>
        <div class="memcheck_analysis_title" onclick="JavaScript: ToogleAnalysisResultVisibility('valgrind.result1');">
            <span id="valgrind.result1.VisibilityIcon"><div class="expand"><div></div></div></span> <span class="brace_recenter">[</span><span class="analysis_error_status">ERROR</span><span class="brace_recenter">]</span> Command: mismatched_delete <span class="analysis_type_infos"><div class="report_summary_errors">Errors: 1</div>
            <div class="report_summary_infos">Infos: 1</div></span>
        </div>
        <div id="valgrind.result1.Report" class="memcheck_analysis_content hidden">
            <span class="result_loader"></span><span class="result_loader_text"></span>
        </div>
    </body>
</html>
